In Yaiba: Ninja Gaiden Z, players will battle fierce zombies as Yaiba, a cyborg ninja who will do anything to get revenge and stay alive. Cleaved in two, he is brought back to life with cyber-technology. Brandishing his ninja sword and the mecha weapons in his cyborg arm, he slaughters zombies with brutal, over-the-top abandon. Step into a stylized living comic book where stunning graphics depict a world gone mad. Hordes of undead can only be stopped by YAIBAs willingness to use any means necessary to get the job done. Will he kill by turning his cyborg arm into a razor chainsaw for slicing up undead or just rip off an opponent's arms to use as zombie nunchucks? Both possibilities fill Yaiba's heart with twisted laughter and the desire to kill more and more zombies!


